import React from 'react';
import ReactDOM from 'react-dom';

function Challange() {
    let currDate = new Date(2020, 7, 17, );
    currDate = currDate.getHours();
    let greeting = {};
    let quotes = {};

    const cssSpan = {};
    const cssP = {};

    if (currDate >= 4 && currDate < 12) {
        greeting = 'Good Morning!';
        cssSpan.color = 'green';
        quotes = 'You can win the morning you can win the day :)';
        cssP.color = '#7cfc00';
    } else if (currDate >= 12 && currDate < 16) {
        greeting = 'Good Afternoon!';
        cssSpan.color = 'orange';
        quotes = 'Eat tight';
        cssP.color = '#yellow';

    } else if (currDate >= 16 && currDate < 20) {
        greeting = 'Good Evening!';
        cssSpan.color = 'skyblue';
        quotes = 'Enjoy the evening';
        cssP.color = 'blue';

    } else {
        greeting = 'Good Night!';
        cssSpan.color = 'black';
        quotes = 'TIme to sleep';
        cssP.color = 'gray';

    }
    return (
        <>
            <div className='greet'>
                <h1>Hey! <span style={cssSpan}>{greeting}</span> </h1>
                <p style={cssP}>{quotes}</p>
            </div>
        </>
    )
}
export default Challange;
